window.bookSummaryJSON = "<p><b>Captain Janeway of the USS </b><b><i>Voyager </i></b><b>tells the story of her life in Starfleet, for fans of </b><b><i>Star Trek</i></b><b>.</b></p> <p>Kathryn Janeway reveals her career in Starfleet, from her first command to her epic journey through the Delta Quadrant leading to her rise to the top as vice-admiral in Starfleet Command. Discover the story of the woman who travelled further than any human ever had before, stranded decades from home, encountering new worlds and species.</p> <p>Explore how she brought together Starfleet and the Maquis as part of her crew, forged new alliances with species across the galaxy and overcame one of Starfleet's greatest threats - the Borg - on their own remote and hostile territory. Get Janeway's personal take on key characters such as Seven of Nine, her trusted friend Tuvok, new arrivals like Neelix, and her second-in-command, Chakotay.</p>"; 
